import React from "react";

const MatchupCard = ({ matchup }) => {
	let mm1 = matchup.team_1.money_multiplier;
	let mm2 = matchup.team_2.money_multiplier;
	if (mm1 == null) {
		mm1 = 0;
	}
	if (mm2 == null) {
		mm2 = 0;
	}
	let wp1 = matchup.team_1.win_probability;
	let wp2 = matchup.team_2.win_probability;
	if (wp1 == null) {
		wp1 = 0;
	}
	if (wp2 == null) {
		wp2 = 0;
	}
	let betAmount = 25;
	let profit1 = betAmount * mm1 - betAmount;
	let profit2 = betAmount * mm2 - betAmount;
	let ev1 = (profit1 * wp1 + -betAmount * (1 - wp1)).toFixed(2);
	let ev2 = (profit2 * wp2 + -betAmount * (1 - wp2)).toFixed(2);

	return (
		<div class="game-card">
			<div class="game-card-header">
				<p>{matchup.gamedate}</p>
			</div>

			<div class="teams">
				<div class="team">
					<img src="../../../img/Boston.png" alt="Warriors" />
					<p>Warriors</p>
				</div>
				<div class="divider">
					<p>@</p>
				</div>
				<div class="team">
					<img src="../../../img/Atlanta.png" alt="Knicks" />
					<p>Sixers</p>
				</div>
			</div>
			<div class="bets">
				<div class="bet" id="better-bet">
					<div class="title">
						<p>GSW Win:</p>
					</div>
					<div class="pct">
						<p>71% Chance</p>
					</div>
					<div class="winning">
						<p>Win $23</p>
					</div>
					<div class="place-bet">
						<button>Add to Cart</button>
					</div>
				</div>
				<div class="bet-divider"></div>

				<div class="bet">
					<div class="title">
						<p>PHI Win:</p>
					</div>
					<div class="pct">
						<p>29% Chance</p>
					</div>
					<div class="winning">
						<p>Win $45</p>
					</div>
					<div class="place-bet">
						<button>Add to Cart</button>
					</div>
				</div>
			</div>
		</div>
	);
};

export default MatchupCard;
